import React from 'react'
import { Link } from 'react-router-dom'

const Service = (props) => {
  return (
    <Link className='service-grid'>

    <div className='service'>
        <div><img src={props.img} alt="" srcset="" /></div>
        <div><h3>{props.service}</h3></div>
    </div>
    </Link>

  )
}

export default Service
